import React from 'react';
import { Link } from 'react-router-dom';
import './Checkout.css';


class Checkout extends React.Component {



  render() {
    const storage = JSON.parse(localStorage.getItem('cart'))
    return (
      <div>
        {storage.map((e) => (
          <div className="list">
            <span>{e.title}</span>
            <span>{e.total}</span>
            <span>{e.price}</span>
          </div>
        ))}
      </div>
    );
  }
}

export default Checkout;
